import React from "react";

const Rating = ({ value, text }) => {
  const ratings = [0, 1, 2, 3, 4];
  return (
    <div className="rating">
      {console.log(value)}

      {ratings.map((j) => {
        <span>
          <i
            className={
              value - j >= 1
                ? "fas fa-start"
                : value - j >= 0.5
                ? "fas fa-star-half-alt"
                : "far fa-star"
            }
          ></i>
        </span>;
      })}
      <span> {text && text} </span>
    </div>
  );
};

export default Rating;
